Duck typing in TypeScript refers to the idea that a variable or function can have an unknown type at runtime based on what it's being used for. This means that you can declare a variable or function with a type that isn't specified in advance, and the compiler will infer the correct type from the context where the variable or function is used.

Here are some key concepts related to duck typing:

1. Type inference: The compiler uses information about the surrounding code (such as the return value of another function) to determine the appropriate type of a variable or function.
2. Static typing: TypeScript enforces static typing, meaning that all variables and functions must be declared with a specific type.
3. Inferred types: The compiler infers the correct type of a variable or function based on its usage and context, rather than specifying it in advance.

Here's an example of duck typing in TypeScript:
```typescript
// Declaration of a function named add
