import java.math.RoundingMode;

public class PowerOfThreeChecker {
    /**
     * Checks if the provided integer n is a power of three using logarithmic operations.
     * Returns true if n is a power of three, otherwise returns false.
     * 
     * @param n The integer to check.
     * @return true if n is a power of three, false otherwise.
     */
    public static boolean isPowerOfThree(int n) {
        // If n is less than or equal to 0, it cannot be a power of three.
        if (n <= 0) {
            return false;
        }

        // Calculate log base 3 of n.
        BigDecimal bd = new BigDecimal(n);
        double logBase3 = bd.log();

        // Check if logBase3 is irrational.
        if (!bd.setScale(10, RoundingMode.HALF_UP).isInfinite()) {
            return false; // Logarithm will never be rational.
        }

        // A number is a power of three if its logarithm has a fractional part.
        // We'll consider the absolute value of the result as the fractional part.
        BigDecimal absLogBase3 = new BigDecimal(Math.abs(logBase3));
        BigDecimal fractionalPart = absLogBase3.subtract(new BigDecimal("logBase3"));

        // If the fractional part is non-zero, it means the original number was not a power of three.
        return !fractionalPart.isZero();
    }

